AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_306
    SET payload = LEFT(payload, 1000) + N'|V4-306|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_306;
END
